import React from "react";

function FeturesData() {
  let data=[
    {id:1,
     name:"paintBrushes",
     img:"https://www.thesprucecrafts.com/thmb/Pz-yTNsj4Xkjof1l_SBuCsDKu70=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/paint-brushes-139613265-5817711f5f9b581c0b53b9a4.jpg"
     },
     {id:2,
      name:"colors",
      img:"https://i.ytimg.com/vi/UJ9iV407Sro/hqdefault.jpg"
      },
      {
        id:3,
        name:"clay-arts",
        img:"https://m.media-amazon.com/images/I/71IRzfpjXNL.jpg"
      }
  ]
  return (
    <>
    {}
      
<div className="card bg-dark text-white">
  <img src="https://m.media-amazon.com/images/I/71IRzfpjXNL.jpg"/>
  <div className="card-img-overlay">
    <h5 className="card-title">Card title</h5>
    <p className="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
    <p className="card-text">Last updated 3 mins ago</p>
  </div>
</div>
    </>
  );
}

export default FeturesData;
